column8:
●濃いシミまでひと塗りでキレイにカバーでき、境目が肌になじみ自然です。<br>
●肌にぴたっと密着し、ベタつかず、さらっとした仕上がり。<br>
●ファンデを重ねてもよれにくいです。<br>
●汗・水に強く、くずれにくいウォータープルーフタイプ。<br>
●スティックタイプだから、ピンポイントに簡単に使えます。<br>
●SPF28 PA++で、紫外線から肌を守り、日やけによるシミ・ソバカスを防ぎます。<br><br>

【ご使用方法】<br>
●5mm程度くり出してご使用ください。出しすぎると折れることがあります。<br>
●カバーしたい部分に適量を塗った後、指先でお肌とおの境目をぼかすようになじませます。<br>
●パウダーファンデーションの前、リキッドファンデーション、クリームファンデーションの後のご使用をおすすめします。<br><br>

【ご注意】<br>
○傷、はれもの、湿疹等、異常のあるときは、ご使用をおやめください。<br>
○使用中、または使用後日光にあたって、赤味、はれ、かゆみ、刺激等の異常が現れたときは、使用を中止し、皮膚科専門医等にご相談をおすすめします。そのまま他の化粧品も含めて使用を続けますと、悪化することがあります。<br>
○使用後は、キャップをきちんとしめてください。<br>
○高温及び直射日光のあたるところには置かないでください。<br>
○使用量が少ないと、紫外線防止効果が得られにくくなります。商品のSPF表示及びPA表示は、国際的に定められている標準塗布量に従い、1立方センチメートルあたり2mgを皮膚に塗布して測定した結果です。<br><br>

【成分】<br>
トリエチルヘキサノイン、マイクロクリスタリンワックス、ナイロン-12、ヘキサ(ヒドロキシステアリン酸/ステアリン酸/ロジン酸)ジペンタエリスリチル、ポリエチレン、テトラヘキシルデカン酸アスコルビル、カミツレエキス、セスキオレイン酸ソルビタン、水酸化Al、カルナウバロウ、ハイドロゲンジメチコン、メチコン、トリ(カプリル酸/カプリン酸)グリセリル、BHT、酸化チタン、酸化鉄<br><br>

【内容量】<br>
1本<br><br>

【販売元】<br>
株式会社伊勢半<br>
東京都千代田区五番町7番地<br>
お問い合わせ先：03-3262-3123<br><br>

【商品区分】<br>
化粧品<br><br>

［ISEHAN/Kiss Me FERME］

